var response = response_body_map || response_body;
var configs = {};
if(!response_iserror) 
{       
  	   if(response.access_token)
 			configs['oauth.user.token'] = response['access_token'];
   	   if(response.refresh_token)
  			configs['oauth.user.refresh_token'] = response['refresh_token'];
       if(response.expires_in)
  			configs['oauth.user.refresh_interval'] = response['expires_in'];

       configs['oauth.user.refresh_time'] = new Date().getTime();

  done({
    "configuration": configs
  });
}
done();

